import React, {Component} from 'react';
import Nav from "../Nav";
import Header from "../Header";

class WorkSpace extends Component {
    render() {
        return (
            <div>
                <Header/>
                <Nav/>
            </div>
        );
    }
}

export default WorkSpace;
